import React, { useState, useEffect } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import FindRoutesModalList from "./FindRoutesModalList";
import M from "materialize-css/dist/js/materialize.min.js";

const FindRoutesModal = ({ route, currentRoute }, props) => {
  const { locationTo, locationFrom, distance, postedOn, postedBy, id } = props;
  console.log(locationTo);
  return (
    <div id="find-routes-modal" className="modal" style={modalStyle}>
      <div className="modal-content">
        <h4>Route Info</h4>
        {route.routes !== null &&
          route.routes.map(route => {
            return <FindRoutesModalList route={route} key={route.id} />;
          })}
      </div>
    </div>
  );
};

const modalStyle = {
  width: "75%",
  height: "75%"
};

FindRoutesModal.propTypes = {
  current: PropTypes.object
};

const mapStateToProps = state => {
  return {
    route: state.route,
    currentRoute: state.route.currentRoutes
  };
};

export default connect(mapStateToProps)(FindRoutesModal);
